import React, { useState } from "react";
import { useAuth } from "../context/AuthContext";

const DoctorDashboard = () => {
  const { logout } = useAuth();
  const [activeSection, setActiveSection] = useState("schedule");

  const renderContent = () => {
    switch (activeSection) {
      case "schedule":
        return <div><h3>Schedule</h3><p>Doctor's schedule details here.</p></div>;
      case "patients":
        return <div><h3>Patients</h3><p>List of patients will go here.</p></div>;
      case "prescriptions":
        return <div><h3>Prescriptions</h3><p>Prescription management here.</p></div>;
      default:
        return null;
    }
  };

  return (
    <div>
      <header style={{ display: "flex", justifyContent: "space-between", padding: "1rem", backgroundColor: "#e0e0e0" }}>
        <div><strong>Logo</strong></div>
        <button onClick={logout}>Sign Out</button>
      </header>
      <aside style={{ float: "left", width: "200px", padding: "1rem", backgroundColor: "#f4f4f4" }}>
        <p 
          style={{ cursor: "pointer", fontWeight: activeSection === "schedule" ? "bold" : "normal" }} 
          onClick={() => setActiveSection("schedule")}
        >
          Schedule
        </p>
        <p 
          style={{ cursor: "pointer", fontWeight: activeSection === "patients" ? "bold" : "normal" }} 
          onClick={() => setActiveSection("patients")}
        >
          Patients
        </p>
        <p 
          style={{ cursor: "pointer", fontWeight: activeSection === "prescriptions" ? "bold" : "normal" }} 
          onClick={() => setActiveSection("prescriptions")}
        >
          Prescriptions
        </p>
      </aside>
      <main style={{ marginLeft: "210px", padding: "1rem" }}>
        <h2>Doctor Dashboard</h2>
        {renderContent()}
      </main>
    </div>
  );
};

export default DoctorDashboard;
